import React, { useState } from 'react'
import Axios from 'axios';

const Checkbook = () => {

    const [bookedList,setBookedList] = useState([]);
    window.addEventListener("load",function(){
        Axios.post('http://localhost:3001/checkbook',{
            val:1,
        }).then((response) =>{
            setBookedList(response.data);
            //alert(JSON.stringify(response.data));
        });
    });

  return (
    <div className="checkbook">
        <h2>All Booked Slots</h2>
        
        <div className="checkbooks">
            <div className="checkbookpnt">
                <p id="checkbookpnt1">SL no</p>
                <p id="checkbookpnt2">SL no</p>
                <p id="checkbookpnt3">SL no</p>
                <p id="checkbookpnt4">SL no</p>
                <p id="checkbookpnt5">SL no</p>
                <p id="checkbookpnt6">SL no</p>
            </div>
            {bookedList.map((item, index) => {
                return <div>
                    <div key={index} className="checkbookpnt">
                        <p id="checkbookpnt1">{index +1}. </p>
                        <p id="checkbookpnt1">{item.day} </p> 
                        <p id="checkbookpnt1">{item.date} </p>
                        <p id="checkbookpnt1">{item.roomno} </p>
                        {item.slotno == "slot1" ? <p  id="checkbookpnt1">8.00-9.15</p> : item.slotno == "slot2" ? <p>9.15-10.30</p> : item.slotno == "slot3" ? <p>10.30-11.45</p> : item.slotno == "slot4" ? <p>11.45-1.00</p> : item.slotno == "slot5" ? <p>1.00-2.30</p> : item.slotno == "slot6" ? <p>2.30-3.45</p> : <p>3.45-5.00</p>}
                        <p> {item.email} </p>
                    </div>
                </div>
            })}
        </div>

    </div>
  )
}

export default Checkbook
